import React from 'react'
import ReactDOM from 'react-dom'

const Header = (props) => {
    console.log(props)
    return (
        <>
        <p>Kurssin nimi: {props.course}</p>
        </>
    )
}

const Part = (props) => {
    console.log(props)
    return (
        <div>
        <p>Osan nimi: {props.part}, tehtäviä: {props.exercises} </p>
        </div>
    )
}

const Content = (props) => {
    console.log(props)
    return (
        <>
        <Part part={props.part1} exercises={props.exercises1}/>
        <Part part={props.part2} exercises={props.exercises2}/>
        <Part part={props.part3} exercises={props.exercises3}/>
        </>
    )


}

const Total = (props) => {
    console.log(props)
    return (
        <>
        <p>Tehtäviä yhteensä: {props.yhteensa}</p>
        </>
    )
}

const App = () => {
  const course = 'Half Stack -sovelluskehitys'
  const part1 = {
      name: 'Reactin perusteet',
      exercises: 10
  }

  const part2 = {
      name: 'Tiedonvälitys propseilla',
      exercises: 7
  }

  const part3 = {
      name: 'Komponenttien tila',
      exercises: 14
  }



  return (
    <>
     <Header course={course}/>
     <Content part1={part1.name} part2={part2.name} part3={part3.name} 
     exercises1={part1.exercises} exercises2={part2.exercises} 
     exercises3={part3.exercises}/>
     <Total yhteensa={part1.exercises + part2.exercises + part3.exercises}/>
    </>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
